import { Outlet } from "react-router-dom";
import { Box, BoxContainer, Container, Link, BoxMain } from "./Layout.styled";

const Layout = () => {
  const isLoading = useSelector(getIsLoading);
  return (
    <Container>
         <BoxContainer>
         <Box>

           <nav>
             <Link to="/"> Home</Link>
             <Link to="todo">Todo List</Link>
           </nav>
           {isLoading && <Loader/>}
         </Box>
         <BoxMain>
           <Outlet />
         </BoxMain>
         </BoxContainer>
    </Container>
  );
};

export default Layout;
